import React from 'react';

const Guideme = () => {
    return(
        <>
            <div id="guideBox" className="guideBox">
                 <div className="msgBox"> 
                    <h1>Check Out Leadership Board Folks</h1>
                    <Link to="/" onClick={guideMenext} className="btn btn-info">Got It!</Link>
               </div>
            </div>
        </>
    );
}
export default Guideme;
